// Extends ProfileListContainer //
export default function ProfileIndexMenu({style, profileDataToRender}) {
  let title = profileDataToRender
            ? 
              <div>
                {profileDataToRender[0].slice(0, 1)[0].index}
              </div>  
            
            : <div></div>

  const renderIndexMenuMainItem = () => {
    return profileDataToRender
         ? <div style={style.indexDataMain}>{profileDataToRender[0].slice(0, 1)[0].index}</div>
         : <div></div>
  }

  const renderIndexMenuSubItems = () => {
    return profileDataToRender
         ? profileDataToRender[0].slice(1).map((item, i) => (
             <div style = {style.indexDataOther}
                  key   = {"pDTR"+i}>
  
               {item['index']}
             </div>
           ))
         : <div></div>

    try {
      return profileDataToRender[0].slice(1).map((item, i) => (
        <div style = {style.indexStyle}
             key   = {"pDTR"+i}>

          {item['index']}
        </div>
      ))
    }
    catch {return <div></div>}
  }

  return (
    <div style={style.indexContainer}>
      {renderIndexMenuMainItem()}

      <div style={style.containerOtherStyle}>
        {renderIndexMenuSubItems()}
      </div>
    </div>
  )
}
